    render() {
        return (
            <div className='createAccForm'>
                <h3> This is the Account Create Section</h3>
                <form>
                    <input type="text" value='' name='firstName' onChange={handleInputChange} placeholder='Doodleblue' />
                    <input type="text" value='' name='lastName' onChange={handleInputChange} placeholder='Innovations' />
                    <input type="email" value='' name='emailId' onChange={handleInputChange} placeholder='doodleblue@example.com' />
                    <input type="number" value='' name='mobileNum' onChange={handleInputChange} placeholder='00000 00000' />
                </form>
            </div>
        );
    }
}
